/**
 * 属性提取的信息
 */
interface IAttributeExtractionInformation {
    /**
     * 是否有动态属性
     */
    hasDynamicValue: boolean;
    /**
     * 是否有名称为 static 的属性
     */
    hasStaticAttribute: boolean;
    /**
     * 是否有 static修饰符
     */
    hasStaticDecorator: boolean;
    /**
     * 是否有事件属性
     */
    hasEvent: boolean;
}
export default IAttributeExtractionInformation;
